import { useState, useEffect } from "react";
import axios from 'axios'
import { Navbar, Container, Nav, NavDropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';

import Menubar from '../elements/menubar';
import { useParams } from "react-router";
function TabContent(props){
  console.log(props.tabContList)
  let cList2 = props.tabContList[props.tab]
  return <Nav className="me-auto">{cList2.map((c, idx)=>{return (<Nav.Link onClick={()=>{window.location.href ="/article" + "/" + props.tab + "/" + idx}}><span  className="navCont">{c}</span></Nav.Link>)})}</Nav>
}

function Tab({tabList, tabContList, c1, c2}) {
  let [tab, setTab] = useState(c1);
  return (
  <div><Nav className="mt-5 mb-3" variant="tabs" defaultActiveKey={c1}>
      {tabList.map((t, idx)=> {
          console.log(t)
          let k = t;
          return (    
          <Nav.Item>
          <Nav.Link eventKey={k} onClick={()=>{setTab(t);/*window.location.href = "/article" + "/" + t + "/" + c2;*/}}>{t}</Nav.Link>
          </Nav.Item>
          )
      }
      )}
  </Nav>
  <Navbar bg="light" expand="xxl">
  <Container>
  <Navbar.Brand href="#home"><span className="navTitle">{tab}</span></Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
  <TabContent tab={tab} tabContList={tabContList} tabList={tabList}/>
  </Navbar.Collapse></Container></Navbar>
  </div>
  
)
}

