export default function Article_category() {
    let [getData, setGetData] = useState(0);
    
  const {c1, c2} = useParams();
  useEffect(() => {
    async function fetchData() {
      const result = await axios.get(
        "/article/" + c1 +"/" + c2
      );
       console.log(result.data);
       setGetData(result.data);
    }
    fetchData();
  }, [])

  return (
    
    <div>
    <header id="header">
      <p id="logo">민법을 적용하는 법</p>
      <Menubar/>
      </header>
    <nav id="nav">&nbsp;</nav>
    <div id="section">
    <div>
        {(typeof getData.c_list2 === 'undefined') ? (
      // fetch가 완료되지 않았을 경우에 대한 처리
      <p>loding...</p>
      ) : ((typeof getData.c_list1 === 'undefined') || (<div>
            <Tab tabList={getData.c_list1} tabContList={getData.c_list2} c1={c1} c2={c2}/>
              {getData.a_dic.name_list}
            </div>
        ))}
    </div>
    </div>
    <aside id="aside">&nbsp;</aside>
    <footer></footer>
  </div>
  )
}
